import { HashRouter } from 'react-router-dom';
import React, {Component} from 'react';
import '../../style.css';
import $ from 'jquery';

// Holds a component for a project that will be clicked on to show the actual project page
export default class AppleLogic extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        // TODO: Pass SVG Elements as props via https://stackoverflow.com/questions/39652686/pass-react-component-as-props
        // TODO: OnClick switch to target site
        return(<div>
            {/* First div is the same title page without the illustration or subtitle or button */}
            {this.props.titlePage}
            <div className="ProjDet-Section">
                <h1 className="ProjDet-h1 ProjectWhiteText"></h1>
                <div className="ProjDet-OverviewWrapper">
                    <div className="ProjDet-OverviewDesc">

                    </div>
                    <div className="ProjDet-OverviewInfo">

                    </div>
                </div>
            </div>
            <div className="ProjDet-Section">
                <h3 className="ProjDet-h3 ProjectWhiteText"></h3>

            </div>
        </div>);
    }
}
